css:
.command-mode-input atom-text-editor[mini] {
  background-color: inherit;
  border: none;
  width: 100%;
  font-weight: normal;
  color: #aaaaaa;
  line-height: 1.28;
  cursor: default;
  white-space: nowrap;
  padding-left: 10px;
}
atom-text-editor.vim-mode.command-mode::shadow .cursor,
atom-text-editor.vim-mode.operator-pending-mode::shadow .cursor,
atom-text-editor.vim-mode.visual-mode::shadow .cursor,
atom-text-editor.vim-mode.command-mode .cursor,
atom-text-editor.vim-mode.operator-pending-mode .cursor,
atom-text-editor.vim-mode.visual-mode .cursor,
atom-text-editor.vim-mode.command-mode::shadow .cursor.blink-off,
atom-text-editor.vim-mode.operator-pending-mode::shadow .cursor.blink-off,
atom-text-editor.vim-mode.visual-mode::shadow .cursor.blink-off,
atom-text-editor.vim-mode.command-mode .cursor.blink-off,
atom-text-editor.vim-mode.operator-pending-mode .cursor.blink-off,
atom-text-editor.vim-mode.visual-mode .cursor.blink-off {
  border: 0;
  background-color: #528bff;
  visibility: hidden;
  opacity: 0.5;
}
atom-text-editor.vim-mode.command-mode.is-focused::shadow .cursor,
atom-text-editor.vim-mode.operator-pending-mode.is-focused::shadow .cursor,
atom-text-editor.vim-mode.visual-mode.is-focused::shadow .cursor,
atom-text-editor.vim-mode.command-mode.is-focused .cursor,
atom-text-editor.vim-mode.operator-pending-mode.is-focused .cursor,
atom-text-editor.vim-mode.visual-mode.is-focused .cursor,
atom-text-editor.vim-mode.command-mode.is-focused::shadow .cursor.blink-off,
atom-text-editor.vim-mode.operator-pending-mode.is-focused::shadow .cursor.blink-off,
atom-text-editor.vim-mode.visual-mode.is-focused::shadow .cursor.blink-off,
atom-text-editor.vim-mode.command-mode.is-focused .cursor.blink-off,
atom-text-editor.vim-mode.operator-pending-mode.is-focused .cursor.blink-off,
atom-text-editor.vim-mode.visual-mode.is-focused .cursor.blink-off {
  border: 0;
  background-color: #528bff;
  visibility: visible;
  opacity: 0.5;
}
atom-text-editor.vim-mode.visual-mode::shadow .cursor.hidden-cursor,
atom-text-editor.vim-mode.visual-mode .cursor.hidden-cursor {
  display: block;
}
